(function (jsPDFAPI) {
    var font = '';
    var callAddFont = function () {
        this.addFileToVFS('Montserrat-Bold.ttf', font);
        this.addFont('Montserrat-Bold.ttf', 'Montserrat', 'bold');
    };
    jsPDFAPI.events.push(['addFonts', callAddFont])
})(jsPDF.API);

